  function handleChange (event) {
    props.setSearchTerm(event.target.value);
  }

  return (
    <>
    <div className="search">
      <input id="search" type="text" onChange={handleChange} placeholder="Que quieres..."></input>
    </div>

    <p>
      {props.searchTerm}
    </p>
    </>

  );
}

export default Search;
